import React from 'react';

const About = () => {
  return (
    <section id="about">
      <div className="container center">
        <div className="row">
          <div className="col ">
            <h3>About Us</h3>
            <p>Behind the CalCountApp, you’ll find our motivated and enthusiastic team. We truly believe in the transformative power of healthy eating. With CalCountApp, we’re helping people live healthier lives through better nutrition.</p>
            <img className="responsive-img" src="https://img.freepik.com/premium-photo/diverse-group-people-laughing-doing-collaboration-create-project-strategy-growth-workers-having-fun-working-business-development-feeling-cheerful-about-job-tripod-shot_482257-41950.jpg?w=2000" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
